import { Link } from "react-router-dom";

//css
import "../Css/Header.css";

function Header() {
	return (
		<header>
			<div className="h-wrap">
				<div className="h-top">
					<Link></Link>
					<h1 className="main-logo">
						<img src="http://www.juunj.com/images/common/logo2014_small_w.png" alt="juun.j" />
					</h1>
				</div>
				<div className="h-bottom"></div>
			</div>
		</header>
	);
}

export default Header;
